we try to support user-defined server side processing with this PR, a user only needs to implement the follow code to do preprocessing for text classification on server side,
``` python
from paddle_serving_server.plugin_service import PluginService
import sys

class IMDBService(PluginService):
    def prepare_service(self, args={}):
        if len(args) == 0:
            exit(-1)
        self.word_dict = {}
        with open(args["dict_file_path"]) as fin:
            idx = 0
            for line in fin:
                self.word_dict[idx] = idx
                idx += 1

    def preprocess(self, feed={}, fetch=[]):
        if "words" not in feed:
            exit(-1)
        res_feed = {}
        res_feed["words"] = [self.word_dict[int(x)] for x in feed["words"]]
        print(res_feed)
        return res_feed, fetch

imdb_service = IMDBService(name="imdb", model=sys.argv[1], port=9898)
imdb_service.prepare_service({"dict_file_path":sys.argv[2]})
imdb_service.start_service()
```

Add an rpc interface `get_config` on serving. So
1. client needs not to prepare the model config file.
2. client can get the `max_batch_size` from this server.

```
message ServingConfig{
    int32 max_batch_size = 1;
    string proto_txt = 2;
};

service MultiLangGeneralModelService {	
  rpc get_config(EmptyRequest) returns (ServingConfig) {}
};
```

